import axios from 'axios';
const url='http://localhost:3000/api/posts';
class UserService{
    //get posts
    static getPosts() {
        return new Promise ((resolve,reject) => {
            axios.get(url).then((res) => {
                const data=res.data;
                resolve(data.body.email)
            })
            .catch((err)=> {
                reject(err);
            })
            
        });
    }
    static insertUser(email,password){
        return axios.post(url+'',{
            email,
            password
        })
    }
}
UserService
